import React from 'react';

const aStyle = {
  color: 'black',
  textDecoration: 'none',
  fontSize: '2rem',
}

function MainLink(linkText) {
  return (
    <>
      <a style={aStyle}>{linkText}</a>
    </>
  )
}

function App() {
  return (
    <>
      <ul>
        <li><a href="https://www.github.com/raphaelrighetti" target="_blank">GitHub</a></li>
        <li><a href="https://www.instagram.com/raphael_righetti" target="_blank">Instagram</a></li>
        <li><a href=""></a></li>
        <li><a href=""></a></li>
        <li><a href=""></a></li>
      </ul>
    </>
  );
}

export default App;
